      (function() {
        var proxied = window.XMLHttpRequest.prototype.send;
        window.XMLHttpRequest.prototype.send = function() {
          var pointer = this

            if (pointer.readyState != 4){
              return;
            }
            location.reload(true)
            clearInterval(intervalId);

        };
      })();
